import React from 'react'

export default function Card({person}) {
  return (
    <>
        <img className='' alt={person.name} src={process.env.PUBLIC_URL + person.imgPath} />
        <div>
            <h2>{person.name}</h2>
            <p>{person.email}</p>
        </div>
      
    </>
  )
}
